<html>
	<head>
		<title>Certificate</title>
		<link rel="icon" href="/favicon.png">
		<script type="text/javascript" src="/lib/active/jquery.min.js"></script>
		<script type="text/javascript" src="/lib/active/qrcode.min.js"></script>
		<style>
		html
		{
			height: 100%;
			font: Monospace 20;
		}

		body 
		{
			color: #009688;
			height: 100%;
		}
		#my-node
		{
			background-image: url("data:image/png;base64,");
			background-color: white;
			color: #009688;
			width: 1280px; 
			height: 810px;
			text-align: center; 
			border: 10px solid #787878;
		}
		#cert
		{
			position: absolute;
			left: 334px;
			top: 175px;
			width: 913px;
			text-align: left;
		}

		.date
		{
			position: absolute; 
			top: 465px; 
			left: 47px; 
			text-align: left;
			float: left;
		}

		#certificate
		{
			font-size: 100pt;
			text-align: left;
		}

		#content
		{
			border-top: 40px solid rgba(0,0,0,0);
			text-align: center;
		}

		table, tbody, tr, td, th
		{
			color: #009688;
		}
		table
		{
			width: 903px;
			text-align: center;
		}

		th
		{
			text-align: right;
			border-left: 15px solid rgba(0,0,0,0);
		}

		#qrcode
		{
			width:300px; 
			height:300px; 
			margin-top:15px;
			left: 706px;
			top: 446px;
			position: absolute;
			float: right;
		}

		.company
		{
			margin-top:15px;
			left: 380px;
			top: 450px;
			position: absolute;
			float: right;
		}

		</style>
	</head>
	<body>
		<div id="my-node">
			<br><br>
			<div id="cert">
				<span id="certificate">Certificate</span>
				<br><br>
				<div id="content">
					<table><tbody>
							<tr>
								<td><span style="font-size:30px"><i>This is to certify that  </i></span></td>
								<th><span style="font-size:35px">{{name}}</span></th>
							</tr>
							<tr>
								<td><span style="font-size:30px"><i>has completed the contest  </i></span></td>
								<th><span style="font-size:35px"> {{contest}}</span></th>
							</tr>
							<tr>
								<td><span style="font-size:30px">with score of  </span></td>
								<th><span style="font-size:35px">{{score}}</span></th>
							</tr>
						</tbody></table>
						<br><br>
				</div>
				<br><br>
				<div class="date">
					<!--
					<span style="font-size:30px"><i>dated</i></span><br>
					<span style="font-size:35px">{{date}}</span>
				</div>
				<div class="company">
					--> <img src="data:image/png;base64," width="150px">
				</div>
				<div id="qrcode">
				</div>
				<br>
			</div>
		</div>
		</div> 
		<script type="text/javascript">
			var qrcode = new QRCode(document.getElementById("qrcode"), {
				width : 150,
				height : 150
			});

			qrcode.makeCode ("https://infocourse.techedu.cf/verify/cert/{{UserID}}/{{ConstestID}}");
		</script>
		<script src="/lib/active/bower_components/dom-to-image/dist/dom-to-image.min.js"> </script>
		<script type="text/javascript"> 
			var node = document.getElementById('my-node');

			domtoimage.toPng(document.getElementById('my-node'))
			.then(function (dataUrl) {
				var img = new Image();
				img.src = dataUrl;
				document.body.removeChild (document.getElementById('my-node'));
				document.body.appendChild (img);
			})
			.catch(function (error) {
				console.error('oops, something went wrong!', error);
			});
		</script>
	</body>

</html>
